    true,nt"url": null,nt"notes": "<p>The dataset provides the total number
    of Qualified Health Plan selections by ZIP Code for the 37 states that use the HealthCare.gov
    platform, including the Federally-facilitated Marketplace, State Partnership Marketplaces
    and supported State-based Marketplaces for the Marketplace open enrollment period
    from November 15, 2014 through February 15, 2015, including additional special enrollment
    period (SEP) activity reported through February 22, 2015. The data represent the
    number of unique individuals who have been determined eligible to enroll in a Marketplace
    plan and had selected a plan by February 15, 2015 (including SEP activity through
    February 22nd). The dataset does not include plan selections from the District of
    Columbia and 13 other states that have State-based Marketplaces. The following information
    is included within the dataset - ZIP Code, State Name, Plan Selections the total
    number of unique individuals who have been determined eligible to enroll in a Marketplace
    plan and have selected a plan through one of the 37 states described above during
    the open enrollment period from November 15, 2014 through February 15, 2015, including
    additional special enrollment period activity reported through February 22, 2015.</p>n",nt"license_title":
